import React, { Component } from "react";
import styled from "styled-components";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

export default class SimpleSlider extends Component {
  render() {
    const settings = {
      dots: true,
      arrow: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
    };

    const Container = styled.div`
      z-index: 1;
      position: relative;
      top: 0;
      left: 0;
      width: 100%;
      height: 540px;
      background: #fff;
      margin-top: 130px;
    `;

    const SlideWrap = styled.div`
      width: 1400px;
    `;
    return (
      <Container>
        <Wrap>
          <h2> skills</h2>
          <Slider {...settings}>
            <SlideWrap>
              <h3>html</h3>
            </SlideWrap>
            <div>
              <h3>css</h3>
            </div>
            <div>
              <h3>JavaScript</h3>
            </div>
            <div>
              <h3>react</h3>
            </div>
            <div>
              <h3>photoshop</h3>
            </div>
            <div>
              <h3>xd</h3>
            </div>
            <div>
              <h3>figma</h3>
            </div>
            <div>
              <h3>github</h3>
            </div>
          </Slider>
        </Wrap>
      </Container>
    );
  }
}
